"use strict";

function countValidWords(sentence) {
    function check(token) {
        let hyphen = false;
        for (let i = 0; i < token.length; i++) {
            const c = token[i];
            if (c.match(/\d/) || (['!', '.', ','].includes(c) && i < token.length - 1)) {
                return false;
            }
            if (c === '-') {
                if (
                    hyphen
                    || i === 0
                    || i === token.length - 1
                    || !token[i - 1].match(/[a-z]/)
                    || !token[i + 1].match(/[a-z]/)
                ) {
                    return false;
                }
                hyphen = true;
            }
        }
        return true;
    }
    return sentence.split(' ').reduce((count, token) => count + (check(token) ? 1 : 0), 0);
}
